import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Parse from 'parse';

const Dashboard = () => {
  const navigate = useNavigate();
  const currentUser = Parse.User.current();

  // ·Ä°·Äê·Äî·Ä∫·Ä∏·ÄÖ·Ä¨·Äõ·ÄÑ·Ä∫·Ä∏ ·Äí·Ä±·Äê·Ä¨·Äô·Äª·Ä¨·Ä∏
  const courses = [
    { id: "linux", title: "Linux Administration", zoom: "https://zoom.us/linux", video: "https://www.youtube.com/embed/v_PjgYVv6Lg", time: "Mon-Wed (7-9 PM)" },
    { id: "cyber", title: "Cyber Security", zoom: "https://zoom.us/cyber", video: "https://www.youtube.com/embed/In8Wv0G-O9w", time: "Tue-Thu (7-9 PM)" },
    { id: "net", title: "Networking", zoom: "https://zoom.us/net", video: "https://www.youtube.com/embed/IPvYjX967cw", time: "Sat-Sun (10-12 AM)" },
    { id: "py_basic", title: "Python (Basic)", zoom: "https://zoom.us/pyb", video: "https://www.youtube.com/embed/kqtD5dpn9C8", time: "Mon-Tue (8-10 PM)" },
    { id: "py_adv", title: "Python (Advanced)", zoom: "https://zoom.us/pya", video: "https://www.youtube.com/embed/Xm_m4_X9J-s", time: "Wed-Thu (8-10 PM)" },
    { id: "hacking", title: "Real World Hacking", zoom: "https://zoom.us/hacking", video: "https://www.youtube.com/embed/3Kq1MIfTWCE", time: "Friday (8-11 PM)" },
  ];

  const [selectedCourse, setSelectedCourse] = useState(courses[0]);

  const handleLogout = async () => {
    await Parse.User.logOut();
    navigate('/login');
  };

  if (!currentUser) return <div style={{textAlign: 'center', color: 'red', marginTop: '50px'}}>Access Denied!</div>;

  return (
    <div style={{ backgroundColor: '#0a192f', minHeight: '100vh', color: '#ccd6f6', display: 'flex', flexDirection: 'column' }}>

      {/* Top Navbar */}
      <nav style={styles.nav}>
        <h2 style={{ color: '#00ff41', margin: 0 }}>CS_SCHOOL DASHBOARD</h2>
        <div style={{ display: 'flex', alignItems: 'center', gap: '20px' }}>
          <span>Agent: <span style={{color: '#00ff41'}}>{currentUser.get('username')}</span></span>
          <button onClick={handleLogout} style={styles.logoutBtn}>LOGOUT</button>
        </div>
      </nav>

      <div style={styles.contentLayout}>

        {/* Left Side: Course Menu */}
        <div style={styles.sidebar}>
          <h3 style={{color: '#8892b0', fontSize: '14px', marginLeft: '10px'}}>MY CLASSES</h3>
          {courses.map(course => (
            <div 
              key={course.id} 
              onClick={() => setSelectedCourse(course)}
              style={{
                ...styles.courseTab,
                backgroundColor: selectedCourse.id === course.id ? '#112240' : 'transparent',
                borderLeft: selectedCourse.id === course.id ? '4px solid #00ff41' : '4px solid transparent',
                color: selectedCourse.id === course.id ? '#00ff41' : '#8892b0'
              }}
            >
              {course.title}
            </div>
          ))}
        </div>

        {/* Right Side: Class Content (Zoom & Video) */}
        <div style={styles.mainArea}>
          <div style={styles.headerBox}>
            <h1 style={{margin: 0}}>{selectedCourse.title}</h1>
            <p style={{color: '#8892b0'}}>Class Time: {selectedCourse.time}</p>
          </div>

          <div style={styles.actionGrid}>
            {/* Zoom Card */}
            <div style={styles.card}>
              <h3 style={{color: '#00ff41'}}>üî¥ Live Zoom Class</h3>
              <p>·Ä°·Äê·Äî·Ä∫·Ä∏·ÄÅ·Äª·Ä≠·Äî·Ä∫·Äõ·Ä±·Ä¨·ÄÄ·Ä∫·Äï·Ä´·ÄÄ ·Ä°·Ä±·Ä¨·ÄÄ·Ä∫·ÄÄ·ÄÅ·Äú·ÄØ·Äê·Ä∫·ÄÄ·Ä≠·ÄØ·Äî·Äæ·Ä≠·Äï·Ä∫·Åç ·Äù·ÄÑ·Ä∫·Äõ·Ä±·Ä¨·ÄÄ·Ä∫·Äï·Ä´·Åã</p>
              <a href={selectedCourse.zoom} target="_blank" rel="noreferrer" style={styles.zoomBtn}>JOIN ZOOM NOW</a>
            </div>

            {/* Video Card */}
            <div style={styles.card}>
              <h3 style={{color: '#00ff41'}}>üì∫ Recorded Lesson (Free)</h3>
              <div style={styles.videoWrapper}>
                <iframe 
                  src={selectedCourse.video} 
                  title="Lesson" frameBorder="0" allowFullScreen
                  style={{width: '100%', height: '200px', borderRadius: '8px'}}
                ></iframe>
              </div>
            </div>
          </div>
        </div>

      </div>
    </div>
  );
};

const styles = {
  nav: { display: 'flex', justifyContent: 'space-between', padding: '15px 5%', background: '#112240', borderBottom: '2px solid #00ff41', alignItems: 'center' },
  logoutBtn: { background: 'transparent', color: '#ff4b2b', border: '1px solid #ff4b2b', padding: '5px 15px', borderRadius: '5px', cursor: 'pointer' },
  contentLayout: { display: 'flex', flex: 1, overflow: 'hidden' },
  sidebar: { width: '280px', background: '#0a192f', borderRight: '1px solid #233554', padding: '20px 10px', display: 'flex', flexDirection: 'column', gap: '5px' },
  courseTab: { padding: '15px', cursor: 'pointer', borderRadius: '4px', transition: '0.3s', fontSize: '15px', fontWeight: 'bold' },
  mainArea: { flex: 1, padding: '40px', overflowY: 'auto' },
  headerBox: { marginBottom: '30px' },
  actionGrid: { display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(350px, 1fr))', gap: '20px' },
  card: { background: '#112240', padding: '25px', borderRadius: '12px', border: '1px solid #233554' },
  zoomBtn: { display: 'block', textAlign: 'center', background: '#00ff41', color: '#0a192f', textDecoration: 'none', padding: '12px', borderRadius: '5px', fontWeight: 'bold', marginTop: '20px' },
  videoWrapper: { marginTop: '15px' }
};

export default Dashboard;
